import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { Image } from '@mui/icons-material';
import Backdrop from '@mui/material/Backdrop';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import Fade from '@mui/material/Fade';
import Typography from '@mui/material/Typography';
import OfferDetail from '../offerDetail/offerDetail';
import { green, grey , brown} from '@mui/material/colors';


const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: brown[600],
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));

  function createData(
    productName: string,
    price: number,
    sellerName: string,
    foodtype: string,
    productDescription: string,
    productImg: string,
  ) {
    return { productName, price, sellerName, foodtype, productDescription, productImg};
  }

 
  const rows = [
    createData('Frozen yoghurt', 159, "David Farms", "Milk Derivates", "This is yogurt",
    ""),
    createData("Apple", 56, "Bruno Farms", "Fruits", "Big fresh apples" ,
    ""),
    createData("Onion", 55, "Carlos Farms", "Vegetables", "This will make you cry", 
    "")
  ];

  const modalStyle = {
    position: 'absolute' as 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 600,
    bgcolor: 'background.paper',
    border: '2px solid #000',
    boxShadow: 24,
    p: 4,
  };  

function RestaurantOfferView() {
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  return (
    <div>
       <TableContainer component={Paper} sx={
        {alignSelf: "center",
        bgcolor: 'background.paper',
        boxShadow: 10,}
       }>
      <Table sx={{ minWidth: 750}} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell >Product Name</StyledTableCell>
            <StyledTableCell align="center">Product Image</StyledTableCell>
            <StyledTableCell align="center">Price</StyledTableCell>
            <StyledTableCell align="center">Seller</StyledTableCell>
            <StyledTableCell align="center">Category</StyledTableCell>
            <StyledTableCell align="center">Description</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.productName}
            onClick= {handleOpen}>

        <Modal
        aria-labelledby="transition-modal-title"
        aria-describedby="transition-modal-description"
        open={open}
        onClose={handleClose}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <Box sx={modalStyle}>
            <OfferDetail></OfferDetail>
          </Box>
        </Fade>
      </Modal>

              <StyledTableCell component="th" scope="row">
                {row.productName}
              </StyledTableCell>
              <StyledTableCell align="center">
              <Image>{row.productImg}</Image>
              </StyledTableCell>
              <StyledTableCell align="center">{row.price}</StyledTableCell>
              <StyledTableCell align="center">{row.sellerName}</StyledTableCell>
              <StyledTableCell align="center">{row.foodtype}</StyledTableCell>
              <StyledTableCell align="left">{row.productDescription}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </div>
  )
}

export default RestaurantOfferView